style.css:
@-moz-document regexp('http(s)?://(trace|pre)\\.corrupt-net\\.org/.*') {
    body {
        background-color: #000;
        color: #aeaeae;
    }
    span#rlsgroup font {
        color: #2d2fff;
    }
    span#rlsgroup a[style] {
        color: #2d2fff !important;
    }
    .slide-out-div {
        background: #242424;
    }
    .textinput {
        color: #aeaeae;
        background-color: #000;
    }
    .button {
        color: #aeaeae;
        background-color: #000;
    }
    select#group_list {
        background-color: #000;
        color: #aeaeae;
    }
}
